webpackJsonp([68146865603404],{333:function(A,e){A.exports={data:{markdownRemark:{html:'<h1>Personal Projects</h1>\n<h2>High School</h2>\n<p>When I was in high school, I enjoyed doing hobbyist electronics projects. My favorite platforms were Arduino, Raspberry Pi, and BeagleBone Black. I still enjoy doing these types of projects; however, I find myself working more on satellites now. You can find a video of some of the robots I built <a href="https://www.youtube.com/watch?v=I1k-_aE0UxU">here.</a></p>\n<p>Another one of my favorite projects was using a Raspberry Pi to allow remotely closing the garage door through a simple web interface. I also built a 3D printer as a high school senior project:</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 450px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="3D Printer"\n        title=""\n        src="/static/printer-93f4e25317cf50539d11720bc52cd26d-9b281.jpg"\n        srcset="/static/printer-93f4e25317cf50539d11720bc52cd26d-e352b.jpg 148w,\n/static/printer-93f4e25317cf50539d11720bc52cd26d-68ba4.jpg 295w,\n/static/printer-93f4e25317cf50539d11720bc52cd26d-9b281.jpg 450w"\n        sizes="(max-width: 450px) 100vw, 450px"\n      />\n    </span>\n  </span>\n  </p>',frontmatter:{title:"Personal"}}},pathContext:{slug:"/projects/personal/"}}}});
